import React from 'react';
import ReactDOM from 'react-dom';

function getDays(){
    fetch('192.168.10.104:5000/love')
    .then(function(response){
        return response.json();
    })
    .then(function(myJson) {
      console.log(JSON.stringify(myJson));
    });
}
console.log(getDays());
